import React, { Component } from 'react'
import { get } from '../../../../utils/axios'

export default class Record extends Component {
    getall = async()=>{
        try{
            let res = await get('/api/getall')
            console.log(res)
        }catch(err){
            console.log("error",err)
     }
    }
    componentDidMount(){
        this.getall()
    }
    render() {
        return (
            <div>
                <div>
                    <table>
                        <tr></tr>
                    </table>
                </div>
            </div>
        )
    }
}
